### Explanation

- **HTML Structure**:
  - A `div` with the class `hero-image` contains the hero section.
  - Inside this `div`, another `div` with the class `hero-text` holds the text and buttons.

- **CSS Styling**:
  - The `.hero-image` class sets the background image with a linear gradient to ensure text readability.
  - The `.hero-text` class centers the text and buttons within the hero image.
  - The `styles.css` file includes additional styling to ensure a cohesive look.

- **Responsiveness and Contrast**:
  - The background image is set to cover the entire viewport height (`100vh`) and is centered.
  - A linear gradient overlay is used to improve text readability on the background image[1][5].

This setup ensures that the hero background is visually appealing, responsive, and effectively communicates the value proposition of FixieRun.
